import React, { useEffect,useState} from 'react';
import Footer from '../Footer';
import Menu from '../Menu';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const Stockdetails = () => {
    const p=useParams();
    const [partdetails, setpartdetails] = useState({nm:{name:''},stk_in:{stock_in:''},stk_out:{}});
    useEffect(() => {
        axios.post('http://localhost/fleet_manage/backend/Parts/stockDetails', {
        id: p.id
      },{
        headers: {
          'Content-Type': 'application/json',
          'Authorization':localStorage.getItem('token')
        }
      }).then(function (response) {
        let data=response.data.stockdetails;
        console.log(data.nm);
        setpartdetails(data)
        
      })
    }, []);
    return (
        <div className="hold-transition sidebar-mini">
            <div className="wrapper">
                <Menu />
                <div className="content-wrapper">
                    <div className="content-header">
                        <div className="container-fluid">
                            <div className="row mb-2">
                                <div className="col-sm-6">
                                    <h1 className="m-0">Parts Inventory</h1>
                                </div>
                                <div className="col-sm-6">
                                    <ol className="breadcrumb float-sm-right">
                                        <li className="breadcrumb-item"><a href="#">Home</a></li>
                                        <li className="breadcrumb-item active">Parts Inventory Details</li>
                                    </ol>
                                </div>
                            </div>
                        </div>
                    </div>

                    <div className="content">
                        <div className="container-fluid">
                            <div className="row">
                                <div className="col-lg-12">
                                    <div className="card card-primary card-outline">
                                        <div className="card-header">
                                            <input type="search" className="m-0 form-control col-lg-3" placeholder='Search parts here' />
                                        </div>
                                        <div className="card-body">
                                            <table className='table table-striped table-bordered table-hover'>
                                                <thead>
                                                    <tr>
                                                        <th>SL</th>
                                                        <th>Name</th>
                                                        <th>Stock</th>
                                                        <th>Sell</th>
                                                        <th>Maintanence</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                
                                                    <tr>
                                                        {/* <td>{1}</td>
                                                        <td>{partdetails.name}</td>
                                                        <td>{partdetails.stk_in}</td>
                                                        <td>{partdetails.stk_out}</td>
                                                        <td>{partdetails.stk_maintain}</td> */}
                                                    </tr>
                                             
                                                </tbody>
                                            </table>

                                        </div>
                                    </div>
                                </div>

                            </div>

                        </div>
                    </div>

                </div>

                <Footer />
            </div>
        </div>
    );
}

export default Stockdetails;
